import React from 'react';
import './App.css'; // Default styling
import Navbar from './Components/Main-page/Navbar'; // Import Navbar component
import Main from './Components/Main-page/Main'; // Import Main component
import Footer from './Components/Main-page/Footer';
import LoginPage from './Components/Login-page/LoginPage';

function App() {
  return (
    <div className="App">
      {/* Add the Navbar component */}
      <Navbar />

      {/* Main content */}
      <Main/>
      {/* footer content */}
      <Footer/>

      {/* log in page*/}
      <LoginPage/>
      {/* signup  page*/}
      <Signuppage/>
    </div>
  );
}

export default App;
